import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Rapidly add multiple items to the cart ---
    // Using a specific selector to get all "Add to Cart" buttons within product cards
    const addToCartButtons = await page.locator('.product-card button.add-to-cart').all();
    if (addToCartButtons.length < 4) {
      throw new Error('Could not find at least 4 "Add to Cart" buttons to perform the test.');
    }

    // Click the first four buttons in quick succession
    for (let i = 0; i < 4; i++) {
      await addToCartButtons[i].click();
    }

    // Verify the cart count has updated by checking the text content
    await page.waitForSelector('div.cart:has-text("4")', { timeout: 5000 });
    const cartTextAfterAdd = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Open the cart and rapidly remove items ---
    // Click the main cart element to open the modal
    await page.locator('div.cart').click();
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_visible.png'));

    // Remove all items from the cart modal
    for (let i = 0; i < 4; i++) {
      // Always click the first remove button, as the list shrinks
      await page.locator('.cart-item button.remove-item').first().click();
    }

    // Verify the cart is now empty
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    const cartTextAfterRemove = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_emptied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_emptied.png'));

    return {
      success: true,
      action: "Performed a rapid cart stress test by adding 4 items and then removing them all.",
      extractedData: {
        cartStatusAfterAdding: cartTextAfterAdd.trim(),
        cartStatusAfterRemoving: cartTextAfterRemove.trim(),
        itemsTested: 4
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
